import React from 'react';
import { Container, Row, Col } from 'reactstrap';
import { Link } from 'react-router-dom';
import shirtList from '../../shared/shirts';
import classes from './TShirtsPage.module.css';

const TShirtsPage = () =>{
    return (
        <div>
            <div>T shirt page</div>
            <Container className={classes.container}>
             <Row>
                 {shirtList.map((shirt) => {
                    return (
                        <Col
                            key={shirt.name}
                            lg={1}
                            md={2}
                            sm={10}
                            className={classes.shirtCard}
                        >
                            <img src={shirt.colors.white.front} />
                            <div>{shirt.name}</div>
                            <div>Available in { Object.keys(shirt["colors"]).length } colors</div>
                            <button> See Page</button>

                        </Col>
                    );
                })}
            </Row>
        </Container>

        </div>

    );
};

export default TShirtsPage;
